-- Table structure for table `whatsapp_templates`
--

CREATE TABLE `whatsapp_templates` (
  `template_id` bigint(20) UNSIGNED NOT NULL,
  `branch_id` bigint(20) UNSIGNED DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `template_text` text NOT NULL,
  `placeholder_keys` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- --------------------------------------------------------

--
-- Structure for view `vw_daily_revenue`
--
DROP TABLE IF EXISTS `vw_daily_revenue`;

CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_daily_revenue`  AS SELECT `invoices`.`branch_id` AS `branch_id`, cast(`invoices`.`created_at` as date) AS `revenue_date`, sum(`invoices`.`total_amount`) AS `total_revenue`, sum(`invoices`.`paid_amount`) AS `total_paid` FROM `invoices` WHERE `invoices`.`status` in ('posted','paid') GROUP BY `invoices`.`branch_id`, cast(`invoices`.`created_at` as date);

-- --------------------------------------------------------

--
-- Structure for view `vw_patient_counts`
--
DROP TABLE IF EXISTS `vw_patient_counts`;

CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_patient_counts`  AS SELECT `registrations`.`branch_id` AS `branch_id`, cast(`registrations`.`registered_at` as date) AS `day`, count(distinct `registrations`.`patient_id`) AS `new_registrations` FROM `registrations` GROUP BY `registrations`.`branch_id`, cast(`registrations`.`registered_at` as date) ;

-- --------------------------------------------------------

--
-- Structure for view `vw_today_opd_queue`
--
DROP TABLE IF EXISTS `vw_today_opd_queue`;

CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_today_opd_queue`  AS SELECT `v`.`visit_id` AS `visit_id`, `v`.`visit_start` AS `visit_start`, `p`.`mrn` AS `mrn`, concat(`p`.`first_name`,' ',ifnull(`p`.`last_name`,'')) AS `patient_name`, `p`.`primary_mobile` AS `primary_mobile`, `v`.`visit_status` AS `visit_status`, `doc`.`full_name` AS `doctor_name` FROM ((`visits` `v` join `patients` `p` on(`v`.`patient_id` = `p`.`patient_id`)) left join `providers` `doc` on(`v`.`primary_provider_id` = `doc`.`provider_id`)) WHERE cast(`v`.`visit_start` as date) = curdate() ;

